import React from "react";
import Highcharts, { color } from 'highcharts';
import HighchartsReact from "highcharts-react-official";
import HighChartsMore from "highcharts/highcharts-more";
import drilldown from "highcharts/modules/drilldown";
function WebDevChart() {
    drilldown(Highcharts);
     HighChartsMore(Highcharts);
    let options = {
        colors: ['#FFD700', '#C0C0C0', '#CD7F32'],
        chart: {
            type: 'column',
            inverted: true,
            polar: true,
            backgroundColor:'transparent',
            height:'320px',
            
        },
        lang: {drillUpText: '<< Back to Top'},
    title: 
    {
      style:{color:'white',fontSize:'15px',fontFamily:'cursive'},
      text: '(Click on each section for more info)'
      
    },
        tooltip: {
            outside: true
        },
        pane: {
            size: '85%',
            innerSize: '20%',
            endAngle: 270
        },
        xAxis: {
            tickInterval: 1,
            labels: {
            align: 'right',
            useHTML: true,
            allowOverlap: true,
            step: 0,
            y: 0,
            style: {
                fontSize: '13px'
            }
            },
            lineWidth: 0,
            categories: ['WebWork'],
        },
        yAxis: {
          crosshair: {
            enabled: true,
            color: '#333'
          },
          lineWidth: 0,
          tickInterval: 25,
          reversedStacks: false,
          endOnTick: true,
          showLastLabel: true
        },
        plotOptions: {
          column: {
            stacking: 'normal',
            borderWidth: 0,
            pointPadding: 0,
            groupPadding: 0.15
          }
        },
        series: [{
          data: [
              {
                  name:'CSS',
                  y:90,
                  drilldown:"CSS"
              }
          ]
        }],

        drilldown: {
            series: [
                {
                    name:"Bootstrap",
                    id:"CSS",
                    type:"packedbubble",
                    data:["BootStrap",10]
                },
                // {
                //     name:"Tailwind",
                //     id:"CSS",
                //     type:"packedbubble",
                //     data:[5]
                // },
                // {
                //     name:"WebKit",
                //     id:"CSS",
                //     type:"packedbubble",
                //     data:[2]
                // }
            ]
        },
        // title: {
        // style:{color:'white',fontSize:'15px',fontFamily:'cursive'},
        // text: '(Click on each section for more info)'
        // },
        
        credits: {
            enabled:false
          }
    
    }


    return (
        <span>
      <HighchartsReact 
        highcharts={Highcharts}
        options={options}
      />
    </span>
    )
}



export default WebDevChart;
